import { Fragment } from "react";
import { useParams,Route } from "react-router-dom";
const QuoteDetail = () => {
  const params = useParams();
  return (
    <Fragment>
      <h1>QuoteDetail page</h1>
      <p> {params.quoteId} </p>
      <Route path ={`/quotes/${params.quoteId}/comments`}></Route>
    </Fragment>
  );
};

export default QuoteDetail;
